The Football League Show 31.08.2013 

Duration: 1 hour, 15 min

Manish Bhasin presents the best of the action from all three divisions of the Football League. 

A classic Lancashire derby takes centre stage this week as Blackburn take on Bolton at Ewood Park. With new manager Brian McDermott beginning to make his presence felt, are the good times coming back to Elland Road? Plus extended highlights of Leeds United's clash with promotion favourites QPR.
